import React from 'react';
import Button from '../partials/Button';

const Nav = () => {
    const blue   = '#307CBF';
    return (
        <nav className="App-nav">
            <p className="nav-title">Piece of Mind</p>
            <ul className="nav-ul">
                <li><a href="/">LINK</a></li>
                <li><a href="/">LINK</a></li>
                <li><a href="/">LINK</a></li>
                <li><a href="/">LINK</a></li>
            </ul>
            <div>
                <Button text="Login" color={blue}/>
                <Button text="Signup" color={blue}/>
            </div>
        </nav>
    )
}

export default Nav;
